         <li className="nav-item">
           <Link className="nav-link" to="/Services" >Services</Link>
         </li>
         <li className="nav-item">
           <Link className="nav-link" to="/About">AboutMe</Link>
         </li>
         <li className="nav-item">
           <Link className="nav-link" to='/Contact'>ContactUs</Link>
         </li>
       </ul>
     </div>
   </div>
 </nav>
 
 
     
     </>
  );
}

export default CollapsibleExample;
